import Logo from '../images/comming-soon.png'
function LogoPage() {
    return (
        <div class="grid grid-cols-2">
            <div className=" w-screen h-screen flex justify-center pt-14"
             style={{backgroundColor :'#e5e7eb'}}>
                    <img src='/static/media/comming-soon.b19db05dba490436409c.png' className='w-96 h-96'/>
            </div>
        </div>  
      );
}

export default LogoPage;
